import React from "react";
import {
  AppBar,
  Toolbar,
  Button,
  Box,
  Typography,
  Container,
} from "@mui/material";
import { Home, Info, Login } from "@mui/icons-material";
import "./App.css";

function App() {
  return (
    <div className="app-container">
      {/* Material UI Navigation Bar */}
      <AppBar
        position="fixed"
        sx={{ backgroundColor: "white", boxShadow: "none" }}
      >
        <Container maxWidth="lg">
          <Toolbar sx={{ justifyContent: "flex-end" }}>
            <Box sx={{ display: "flex", gap: 2 }}>
              <Button
                color="inherit"
                startIcon={<Home />}
                sx={{
                  color: "#537955",
                  backgroundColor: "transparent",
                  "&:hover": {
                    color: "#e95d4d",
                    backgroundColor: "transparent",
                  },
                }}
              >
                Home
              </Button>
              <Button
                color="inherit"
                startIcon={<Login />}
                sx={{
                  color: "#537955",
                  backgroundColor: "transparent",
                  "&:hover": {
                    color: "#e95d4d",
                    backgroundColor: "transparent",
                  },
                }}
              >
                Sign In
              </Button>
              <Button
                variant="contained"
                color="inherit"
                startIcon={<Info />}
                sx={{
                  color: "#537955",
                  backgroundColor: "transparent",
                  "&:hover": {
                    color: "#e95d4d",
                    backgroundColor: "transparent",
                  },
                }}
              >
                About Us
              </Button>
              <Button
                variant="contained"
                sx={{
                  backgroundColor: "#e95d4d",
                  color: "white",
                  "&:hover": { backgroundColor: "#d04a3a" },
                }}
              >
                Contact Us
              </Button>
            </Box>
          </Toolbar>
        </Container>
      </AppBar>

      {/* Main Content */}
      <Container sx={{ mt: 12, textAlign: "center" }}>
        <div className="content-container">
          <h1 className="title">Bloom Well</h1>
          <p className="tagline">
            "When things change inside you, things change around you"
          </p>
          <img src="/background.jpg" alt="Mind Blooming" className="bg-image" />
        </div>
      </Container>
    </div>
  );
}

export default App;
